import { NativeSelect, FormControl } from "./components";

const CountryPicker = () => {
  return (
    <div>
      <FormControl>
        <NativeSelect>
          <option value="global">Global</option>
        </NativeSelect>
      </FormControl>
    </div>
  );
};

export default CountryPicker;
